import React, { Component } from "react";
import "../../App.css";

export class Comment extends Component {
  render() {
    return (
      <form>
        <div>
          <textarea
            id="commentSection"
            row="5"
            col="30"
            placeholder="Write your comment..."
          ></textarea>
          <button
            className="btn btn-outline-primary"
            type="submit"
            style={{ marginLeft: "45rem", marginTop: "-2rem" }}
          >
            Submit
          </button>
        </div>
      </form>
    );
  }
}

export default Comment;
